import styled, { css } from 'styled-components';

export const HighlightedContainer = styled.div`
    background-color: var(--highlightedContainer);
    border-radius: 15px;
    box-shadow: 0px 0px 10px 0px rgba(0,0,0,0.1);
    margin-top: 15px;
    padding: 10px;
    width: 100%;
    color: var(--textOnBright);
`;
